25.raw:
arr = (values) => {
  let v = nil
  for (let i=values.length-1;i>=0;i--) {
    v = cons(values[i], v)
  }
  return v
}

33.raw:
parse = node => {
  switch (node.type) {
    case 'identifier': {
      const v = +node.text
      if (!isNaN(v)) {
        return {type: 'eprim', 0: {type: 'pint', 0: v, 1: node.loc}
    }
  }
}

